早幾個月既事：<br />
諧星私接黑道尾牙被處分 引爆藝人指控公司才是源頭？ 吉本興業黑道尾牙事件懶人包<br />
<a href="https://www.kkbox.com/tw/tc/column/showbiz-0-7986-1.html" data-sr-url="https://r.lihkg.com/link?u=https%3A%2F%2Fwww.kkbox.com%2Ftw%2Ftc%2Fcolumn%2Fshowbiz-0-7986-1.html&d=yqGHcbR114BEm%2FDIyWJWfnd5d2ehbLCfOFFYxDFDkZk%3D&h=4a181fa2" target="_blank">https://www.kkbox.com/tw/tc/column/showbiz-0-7986-1.html</a><br />
// 記者會後，吉本興業旗下藝人紛紛跳出來，表示對公司的「不信任感」。當家藝人松本人志於推特上說：「後輩的新人開始不安了。松本 我要開始行動了。」並將21日原本錄播的《ワイドナショー（Wide na Show）》改為直播，在直播上抨擊社長岡本昭彥的威脅事件，並表示這種時候公司應該是要站在藝人的立場，保護藝人才對，而不是打壓、威脅，甚至是放棄藝人。//<br />
// 日本娛樂圈重量級人物北野武也於另一檔節目上暗指「如果經紀公司給的薪水夠多的話，沒有人想要私下接別的工作」，更痛批吉本興業把身為諧星的宮迫博之、田村亮逼哭成那個樣子，真的有很大的問題。//<br />
// 吉本興業的所屬藝人西田淳裕，在推特上爆出公司給藝人的表演費，一場只給1圓日幣（約0.29台幣）的酬勞，並將薪資條的照片一併發出來，讓不少人感到憤怒：「只有1圓？！吉本興業太過分了吧！」也有許多人表示「難怪藝人要私下去接別的工作！」//
